import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { Login } from "./components/Login";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { userList: [] };
  }

  callAPI() {
    fetch("/users")
      .then(res => res.json())
      .then(res => {
        console.log(res);
        this.setState({ userList: res });
      });
  }

  componentWillMount() {
    this.callAPI();
  }
  render() {
    var users = this.state.userList.map(user => {
      return <li key={user.id}>{user.username}</li>;
    });
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <a>{this.state.res}</a>
        </header>
      </div>
    );
  }
}

export default App;
